import { ActionCreators } from 'redux-undo';

export const getDashboard = () =>(dispatch)=> {

    fetch('http://localhost:5000/api/tasklists')
    .then(response=>response.json())
    .then(lists => dispatch({type: 'SHOW_DASHBOARD',payload: lists}))
}
